import { ErrorMessage, Field, Form, Formik } from 'formik';
import React, { useEffect, useState, useRef } from 'react';
import { Link } from "react-router-dom";
import { getUser } from '../../Utils/Common';
import { useLocation } from 'react-router-dom';
import '../../Utils/Constants';
import ModalGen from '../../Utils/Modals/ModalGeneric';
import GenericApi from '../../Api/Services/GenericApi';
import { useParams } from "react-router";
import Spinner from '../../Utils/Spinner';
import Center from '../../Utils/Styles/Center.js'
import moment from 'moment';

function ActuacionesMigracionForm() {

    const [getMaximoTextArea, setMaximoTextArea] = useState(0);
    const [getMinimoTextArea, setMinimoTextArea] = useState(0);
    const [countTextArea, setCountTextArea] = useState(0);
    const [getLista, setLista] = useState({ title: "", message: "", show: false });
    const [getModalState, setModalState] = useState({ title: "", message: "", show: false });
   

    let { radicado, vigencia, id, item } = useParams();


    const [nombre, setNombre] = useState('');
    const [tipo, setTipo] = useState('');
    const [autoNumero, setAutoNumero] = useState('');
    const [fecha, setFecha] = useState('');
    const [fechaTermino, setFechaTermino] = useState('');
    const [instancia, setInstancia] = useState('');
    const [decision, setDesicion] = useState('');
    const [terminoMonto, setTerminoMonto] = useState('');
    const [observacion, setObservacion] = useState('');

    const [getListaActuaciones, setListaActuaciones] = useState({ data: {} });
    const [existeListaActuaciones, setExisteListaActuaciones] = useState(false);

    useEffect(() => {
        async function fetchData() {
            window.showSpinner(true);
            lista();
            
        }
        fetchData();
    }, []);


    const lista= () => {
        try {

            //buscamos el parametro
            GenericApi.getGeneric("migracion-actuacion/"+radicado+"/"+vigencia+"/"+item).then(
                datos => {

                    if (!datos.error) {
                        setLista(datos);
                        actuaciones();
                    } else {
                        //setModalState({ title: "Antecedentes", message: datos.error.toString(), show: true, redirect: '/AntecedentesForm', alert: global.Constants.TIPO_ALERTA.ERROR });
                    }
                    
                }
            )
        } catch (error) {
            // console.log(error);
        }
    }


    const actuaciones= () => {
        try {

            GenericApi.getGeneric("vigencia").then(
                datos => {

                    if (!datos.error) {
                        setExisteListaActuaciones(datos);
                        setExisteListaActuaciones(true);
                    } else {
                        //setModalState({ title: "Antecedentes", message: datos.error.toString(), show: true, redirect: '/AntecedentesForm', alert: global.Constants.TIPO_ALERTA.ERROR });
                    }
                    
                    window.showSpinner(false);
                }
            )
        } catch (error) {
            // console.log(error);
        }
    }


    const handleClick = (event, i) => {

        if(i===1){
            setNombre(getLista.data[0].attributes.nombre);
        }

        else if(i===2){
            setTipo(getLista.data[0].attributes.tipo);      
        }

        else if(i===3){
            setAutoNumero(getLista.data[0].attributes.autoNumero);
        }

        else if(i===4){
            setFecha(getLista.data[0].attributes.fecha);      
        }

        else if(i===5){
            setFechaTermino(getLista.data[0].attributes.fechaTermino);      
        }

        else if(i===6){
            setInstancia(getLista.data[0].attributes.instancia);      
        }

        else if(i===7){
            setDesicion(getLista.data[0].attributes.decision);      
        }

        else if(i===8){
            setTerminoMonto(getLista.data[0].attributes.terminoMonto);      
        }

        else if(i===9){
            setObservacion(getLista.data[0].attributes.observacion);      
        }

    };


    const handleInputChange = (event, i) => {
     
        if(i===1){
            setNombre(event.currentTarget.value);
        }

        else if(i===2){
            setTipo(event.currentTarget.value)
        }

        else if(i===3){
            setAutoNumero(event.currentTarget.value)
        }

        else if(i===4){
            setFecha(event.currentTarget.value)
        }

        else if(i===5){
            setFechaTermino(event.currentTarget.value)
        }

        else if(i===6){
            setInstancia(event.currentTarget.value)
        }

        else if(i===7){
            setDesicion(event.currentTarget.value)
        }

        else if(i===8){
            setTerminoMonto(event.currentTarget.value)
        }

        else if(i===9){
            setObservacion(event.currentTarget.value)
        }


        return true;

        //return true;
    }



    const infoInteresado = () => {

        if (getLista.data != null && typeof (getLista.data) != 'undefined') {
            return (

                getLista.data.map((item, i) => {
                    return (
                        <>
                        {/* 1. NOMBRE */}   
                        <div className="col-md-5">
                            <div className="form-group">
                                <label htmlFor="nombre_origen">Nombre</label>
                                <Field value={item.attributes.nombre} as="input" type="text" autoComplete="off" 
                                className="form-control" id="nombre_origen" name="nombre_origen">                                   
                                </Field>
                            </div>
                        </div>
                        
                        <div className="col-md-2">
                            <div className="form-group">
                                <Center>
                                    <button type="button" className="btn btn-success" onClick={event => handleClick(event, 1)}>
                                        <i class="fas fa-angle-double-right"></i></button>
                                </Center>
                            </div>
                        </div>    
                            
                        <div className="col-md-5">
                           <div className="form-group">
                                <label htmlFor="nombre_destino">Nombre<span className="text-danger">*</span></label>
                                <Field value={nombre} as="input" type="text" autoComplete="off" className="form-control" 
                                id="nombre_destino" name="nombre_destino" onChange={event => handleInputChange(event, 1)}></Field>
                                <Field value={nombre} onChange={event => handleInputChange(event, 3)} as="select" className="form-control" 
                                    id="etapa_destino" name="etapa_destino">
                                    <option value="">Por favor seleccione</option>
                                    {existeListaEtapas ? listaEtapas() : null}
                                </Field>
                            </div>
                        </div> 

                        {/* 2. TIPO */}   
                        <div className="col-md-5">
                            <div className="form-group">
                                <label htmlFor="tipo_origen">Tipo</label>
                                <Field value={item.attributes.tipo} as="input" type="text" autoComplete="off" 
                                className="form-control" id="tipo_origen" name="tipo_origen"></Field>
                            </div>
                        </div>
                        
                        <div className="col-md-2">
                            <div className="form-group">
                                <Center>
                                    <button type="button" className="btn btn-success" onClick={event => handleClick(event, 2)}>
                                        <i class="fas fa-angle-double-right"></i></button>
                                </Center>
                            </div>
                        </div>    

                        <div className="col-md-5">
                           <div className="form-group">
                                <label htmlFor="tipo_destino">Tipo<span className="text-danger">*</span></label>
                                <Field value={tipo} as="input" type="text" autoComplete="off" className="form-control" 
                                id="tipo_destino" name="tipo_destino" onChange={event => handleInputChange(event, 2)}>

                                </Field>
                            </div>
                        </div>


                        {/* 3. AUTO NUMERO */}   
                        <div className="col-md-5">
                            <div className="form-group">
                                <label htmlFor="auto_origen">Número de auto</label>
                                <Field value={item.attributes.autoNumero} as="input" type="text" autoComplete="off" 
                                className="form-control" id="auto_origen" name="auto_origen"></Field>
                            </div>
                        </div>
                        
                        <div className="col-md-2">
                            <div className="form-group">
                                <Center>
                                    <button type="button" className="btn btn-success" onClick={event => handleClick(event, 3)}>
                                        <i class="fas fa-angle-double-right"></i></button>
                                </Center>
                            </div>
                        </div>    
                            
                        <div className="col-md-5">
                           <div className="form-group">
                                <label htmlFor="auto_destino">Número de auto<span className="text-danger">*</span></label>
                                <Field value={autoNumero} as="input" type="text" autoComplete="off" className="form-control" 
                                id="auto_destino" name="auto_destino" 
                                onChange={event => handleInputChange(event, 3)}></Field>
                            </div>
                        </div> 

                        {/* 4. FECHA */}   
                        <div className="col-md-5">
                            <div className="form-group">
                                <label htmlFor="fecha_origen">Fecha</label>
                                <Field value={item.attributes.fecha} as="input" type="text" 
                                autoComplete="off" className="form-control" 
                                id="fecha_origen" name="fecha_origen"></Field>
                            </div>
                        </div>
                        
                        <div className="col-md-2">
                            <div className="form-group">
                                <Center>
                                    <button type="button" className="btn btn-success" onClick={event => handleClick(event, 4)}>
                                        <i class="fas fa-angle-double-right"></i></button>
                                </Center>
                            </div>
                        </div>    
                            
                        <div className="col-md-5">
                           <div className="form-group">
                                <label htmlFor="fecha_destino">Fecha<span className="text-danger">*</span></label>
                                <Field value={fecha} as="input" type="text" autoComplete="off" className="form-control" 
                                id="fecha_destino" name="fecha_destino" 
                                onChange={event => handleInputChange(event, 4)}></Field>
                            </div>
                        </div> 


                        {/*5. FECHA DE TERMINO*/}   
                        <div className="col-md-5">
                            <div className="form-group">
                                <label htmlFor="fecha_termino_origen">Fecha de término</label>
                                <Field value={item.attributes.fechaTermino} as="input" type="text" autoComplete="off" className="form-control" 
                                id="fecha_termino_origen" name="fecha_termino_origen"></Field>
                            </div>
                        </div>
                        
                        <div className="col-md-2">
                            <div className="form-group">
                                <Center>
                                    <button type="button" className="btn btn-success" onClick={event => handleClick(event, 5)}>
                                        <i class="fas fa-angle-double-right"></i></button>
                                </Center>
                            </div>
                        </div>    
                            
                        <div className="col-md-5">
                           <div className="form-group">
                                <label htmlFor="fecha_termino_destino">Fecha de término<span className="text-danger">*</span></label>
                                <Field value={fechaTermino} as="input" type="text" autoComplete="off" className="form-control" 
                                id="fecha_termino_destino" name="fecha_termino_destino" onChange={event => handleInputChange(event, 5)}></Field>
                            </div>
                        </div>

                        {/* 6. INSTANCIA */}   
                        <div className="col-md-5">
                            <div className="form-group">
                                <label htmlFor="instancia_origen">Instancia</label>
                                <Field value={item.attributes.instancia} as="input" type="text" autoComplete="off" className="form-control" 
                                id="instancia_origen" name="instancia_origen"></Field>
                            </div>
                        </div>
                        
                        <div className="col-md-2">
                            <div className="form-group">
                                <Center>
                                    <button type="button" className="btn btn-success" onClick={event => handleClick(event, 6)}>
                                        <i class="fas fa-angle-double-right"></i></button>
                                </Center>
                            </div>
                        </div>    
                            
                        <div className="col-md-5">
                           <div className="form-group">
                                <label htmlFor="instancia_destino">Instancia<span className="text-danger">*</span></label>
                                <Field value={instancia} as="input" type="text" autoComplete="off" className="form-control" 
                                id="instancia_destino" name="instancia_destino" onChange={event => handleInputChange(event, 6)}></Field>
                            </div>
                        </div> 

                        {/* 7. DECISION */}   
                        <div className="col-md-5">
                            <div className="form-group">
                                <label htmlFor="decision_origen">Decisión</label>
                                <Field value={item.attributes.decision} as="input" type="text" autoComplete="off" className="form-control" 
                                id="decision_origen" name="decision_origen"></Field>
                            </div>
                        </div>
                        
                        <div className="col-md-2">
                            <div className="form-group">
                                <Center>
                                    <button type="button" className="btn btn-success" onClick={event => handleClick(event, 7)}>
                                        <i class="fas fa-angle-double-right"></i></button>
                                </Center>
                            </div>
                        </div>    
                            
                        <div className="col-md-5">
                           <div className="form-group">
                                <label htmlFor="decision_destino">Decisión<span className="text-danger">*</span></label>
                                <Field value={decision} as="input" type="text" autoComplete="off" className="form-control" 
                                id="decision_destino" name="decision_destino" onChange={event => handleInputChange(event, 7)}></Field>
                            </div>
                        </div> 

                        {/* 8. TERMINO MONTO */}   
                        <div className="col-md-5">
                            <div className="form-group">
                                <label htmlFor="decision_origen">Término monto</label>
                                <Field value={item.attributes.terminoMonto} as="input" type="text" autoComplete="off" className="form-control" 
                                id="decision_origen" name="decision_origen"></Field>
                            </div>
                        </div>
                        
                        <div className="col-md-2">
                            <div className="form-group">
                                <Center>
                                    <button type="button" className="btn btn-success" onClick={event => handleClick(event, 8)}>
                                        <i class="fas fa-angle-double-right"></i></button>
                                </Center>
                            </div>
                        </div>    
                            
                        <div className="col-md-5">
                           <div className="form-group">
                                <label htmlFor="decision_destino">Término monto<span className="text-danger">*</span></label>
                                <Field value={terminoMonto} as="input" type="text" autoComplete="off" className="form-control" 
                                id="decision_destino" name="decision_destino" onChange={event => handleInputChange(event, 8)}></Field>
                            </div>
                        </div>

                        {/* 9. OBSERVACION */}   
                        <div className="col-md-5">
                            <div className="form-group">
                                <label htmlFor="observacion_origen">Observación</label>
                                <Field value={item.attributes.observacion} as="input" type="text" autoComplete="off" className="form-control" 
                                id="observacion_origen" name="observacion_origen"></Field>
                            </div>
                        </div>
                        
                        <div className="col-md-2">
                            <div className="form-group">
                                <Center>
                                    <button type="button" className="btn btn-success" onClick={event => handleClick(event, 9)}>
                                        <i class="fas fa-angle-double-right"></i></button>
                                </Center>
                            </div>
                        </div>    
                            
                        <div className="col-md-5">
                           <div className="form-group">
                                <label htmlFor="observacion_destino">Observación<span className="text-danger">*</span></label>
                                <Field value={observacion} as="input" type="text" autoComplete="off" className="form-control" 
                                id="observacion_destino" name="observacion_destino" onChange={event => handleInputChange(event, 9)}></Field>
                            </div>
                        </div>

                        </>
                    )
                })
            )
        }
    }

    const enviarDatos = (datos) => {
        window.showSpinner(true);
        let data;

        /*data = {
            "data": {
                "type": 'antecedente',
                "attributes": {
                    "antecedentes": 3,
                    "descripcion": datos.descripcion,
                    "id_proceso_disciplinario": procesoDisciplinarioId,
                    "fecha_registro": Date.now(),
                    "id_dependencia": dependencia ? dependencia : "",
                }
            }
        }

        GenericApi.addGeneric("antecedentes",data).then(
            datos => {
                if (!datos.error) {
                    setModalState({ title: "SINPROC No "+radicado+" :: Crear Antecedente", message: 'Registro Exitoso', show: true, redirect: '/AntecedentesLista', from: {from}, alert: global.Constants.TIPO_ALERTA.EXITO});
                }
                else {
                    setModalState({ title: "SINPROC No "+radicado+" :: Crear Antecedente", message: datos.error.toString(), show: true, redirect: '/AntecedentesLista', from: {from}, alert: global.Constants.TIPO_ALERTA.ERROR });
                }
                window.showSpinner(false);

            }
        )*/
    }

    return (
        <>
            {<Spinner />}   
            {<ModalGen data={getModalState} />}
          
            <Formik
                initialValues={{
                    antecedente_origen: '',
                    antecedente_destino: '',
                    fecha_antecedente_origen: '',
                    fecha_antecedente_destino: '',
                }}
                enableReinitialize
                validate={(valores) => {
                    let errores = {}

                    return errores
                }}
                onSubmit={(valores, { resetForm }) => {
                    enviarDatos(valores);
                }}
            >

                {({ errors }) => (
                    <Form>

                    <div className="w2d_block">
                        <nav aria-label="breadcrumb">
                        <ol className="breadcrumb breadcrumb-alt push">
                            <li class="breadcrumb-item"> <Link underline="hover" className="text-dark" to={`/Buscador`}><small>Buscador</small></Link></li>
                            <li class="breadcrumb-item"> <Link underline="hover" className="text-dark" to={`/ProcesoDisciplinarioMigracion/${radicado}/${vigencia}`}><small>Inicio proceso de migración</small></Link></li>
                            <li class="breadcrumb-item"> <Link underline="hover" className="text-dark" to={`/ListarMigracionActuaciones/${radicado}/${vigencia}`}><small>Lista de actuaciones</small></Link></li>
                            <li class="breadcrumb-item"> <small>Actuaciones</small></li>
                        </ol>
                        </nav>
                    </div>

                      
                        <div className="block block-themed">
                            <div className="block-header">
                                <h3 className="block-title">Proceso disciplinario No  :: <strong>Migrar entidad {item}</strong></h3>
                            </div>

                            <div className="block-content">

                                <div className='text-right'>

                                    <Link to={`/AntecedentesLista/`} title='Regresar a lista de Antecedentes' >
                                        <button type="button" className="btn btn-success"><i className="fas fa-backward"></i> </button>
                                    </Link>
                                </div>

                                <div className="row">

                                    {infoInteresado()}
                                    
                                </div>

                            </div>
                            <div className="block-content block-content-full text-right bg-light">
                                <button type="submit" className="btn btn-rounded btn-primary">Registrar</button>

                                <Link to={`/AntecedentesLista/`}>
                                    <button type="button" className="btn btn-rounded btn-outline-primary">Cancelar</button>
                                </Link>
                            </div>
                        </div>
                    </Form>
                )}
            </Formik>
        </>
    );
}


export default ActuacionesMigracionForm;
